import React from 'react';

export default function Ad({ props }) {
  if (!props) {
    return null;
  }
  return (
    <div style={{ backgroundSize: 'cover', width: '100%' }}>
      <img src={process.env.PUBLIC_URL + '/img/umcImg.svg'} alt='logo' />
    </div>
  );
}
